import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Calendar from 'react-calendar';
import { Link } from "react-router-dom";


function Header() {

  return (
     <div className="layout-header">
        {/* Header Top */}
        <div className="header-top">
            <a href="javascript:" className="btn-back">뒤로가기 버튼</a>
            <a href="javascript:" className="txt-logo">D.I.A.R.Y</a>
            <div className="ui-right">
            <div className="data-id">User id</div>
            <a href="javascript:" className="link-login">로그인</a>

            </div>
        </div>
        <BrowserRouter>
        <div className="header-menu">
            <Link to="/todolist">Todo 리스트</Link>
            <Link to="/diary">다이어리</Link>
            <Link to="/calendar">캘린더</Link>
            <Link to="/gallary">갤러리</Link>
        </div>
        <Routes>
            <Route path="/todolist" element={<Todolist/>}></Route>
            <Route path="/todolist" element={<Diary/>}></Route>
        </Routes>

        </BrowserRouter>
   </div>

  );
}
export default Header;
